import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import { USER_INFO_STORAGE_KEY } from "./components/constants";
import { useNavigate } from 'react-router-dom';
import { useEffect } from 'react';
import Home from "./pages/home/Home";
import Login from "./pages/login/Login";
import Doctors from "./pages/doctors/Doctors";
import Patients from "./pages/patients/Patients";
import CreatePatient from "./pages/patients/CreatePatient";

function App() {
  const isLoggedIn = true;

  return (

    <BrowserRouter>
      <Routes>
        <Route path="/" >
          <Route index element={<Login />}></Route>
          <Route path="dashboard" element={<Home />}></Route>
          <Route path="patients">
            <Route index element={<Patients />}></Route>
            <Route path=":patientId" element={<Patients />}></Route>
            <Route path="new" element={<CreatePatient />}></Route>
          </Route>
          <Route path="doctors">
            <Route index element={<Doctors />}></Route>
            <Route path=":doctorId" element={<Doctors />}></Route>
            <Route path="new" element={<Doctors />}></Route>
          </Route>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
